import { Row, Col } from "react-bootstrap";
import { Menus } from "../utils/index";

const DaftarProduk = ({menus}) => {
	return (
		<Col>
			<h4>
				<strong>Daftar Produk</strong>
			</h4>
			<hr />
			<Row>
				{menus.map((menu) => (
					<Menus
						key={menu.id}
						nama={menu.nama}
						gambar={menu.gambar}
						harga={menu.harga}
						kategori={menu.category}
					/>
				))}
			</Row>
		</Col>

	);
};

export default DaftarProduk;
